    "TranscribedText (Text)": "1/ The University \n\nA Brief History\nThe founding of Howard university can be traced back to a meeting of ten members of the First Congregational Society of Washington on a morning in November 1866.  AT this meeting the plans were laid for a theioofoical seminary for the training of black ministers to help uplift the foure million freed slaves and the remaining 25000 blacks who had been born free. \n\nAfter earnest and prayerful deliberation the society members soon founded the Howard normal and Theological institute for the education of teachers and preachers. The institute was named for major general Oliver Otis Howard, commissioner at the time of the freedmen's bureau and one of the ten founding society members.\n\nGeneral Howard a Civil War hero and a devoutly religious man was prominent in national affairs and in the promotion of the welfare of slaves and freedmen. A visit to the south just prior to the founding of Howard had particularly aroused his interest in providing educational opportunities for freedmen so much so that his fellow society members chose to name the proposed institution after him. General Howard served asHoward’s president from 1869 to 1873.\n\nAs the concept of Howard grew to be more than a mere institute so did plans for congressional support, on january 8 1867 the board of trustees voted to change the name to Howard University . About three weeks later congress passed a bill officially incorporating the university. On march 2, 1867 during the last session of the 39th congress a charter was given to the university organizing the board of trustees president, secretary, treasurer, and executive committee. The charter specified the following departments : normal and preparatory collegiate theological , medical, law, and agriculture. The first students enrolled were four white girls, daughters of two of the university’s founders.\n\nHoward University is a private institution supported by the federal government corporations, foundations, and individual contributions from alumni and friends. Its reputation as a university of international stature, moral leadership, and academic diversity is deeply embedded in the nature and fabric of the 125 years of existence. It is the only truly comprehensive predominantly black institution of higher education in the world.\n\nThe University’s 17 schools and colleges embody a tradition of academic excellence offering degree programs in more than 200 specialized subjects with doctorates offered in more than 23 areas. The schools and colleges are the colleges of allied health and sciences, dentistry, fine arts, arts and sciences, medicine, pharmacy and pharmaceutical sciences, and nursing, and the schools of architecture and planning, business communications, continuing education, divinity education, engineering, law, social work and the graduate school of arts and sciences.\n\nAn array of institutes and centers address a number of national concerns as well as those of the immediate Washington DC vicinity. These facilities are either conducting ongoing research, serving as national clearinghouses or otherwise serving their varied constituencies. Areas of emphasis include cancer, sickle cell disease, family planning, handicapped children and youth, housing, child development and family life, drug abuse and addiction, and labor management relations.",
