    "TranscribedText (Text)": "A Word of Welcome:\n\nThe faculty, students, and staff at Winward community college are pleased that you have chosen to explore our college by reading the Winward Community College Catalog, 1991 - 1992. You are certain to find that our instructional programs and services offer you many opportunities for intellectual growth and personal development. We can help prepare you to transfer to a four-year college by providing you a first-rate education. Our programs can also train you to develop the technical skills necessary for employment in Hawaii’s businesses and government agencies. \n\nWe are a friendly campus, nestled at the toot of the Koolau mountain range, offering several alternatives for achieving post-high school education or simply for pursuing an interest through our non-credit programs. While many students spend the better part of each day with us completing liberal arts courses in order to earn an A.A. degree (credits may be transferred to a four-year college or university) others come to take only a course or two and learn a bit more about the world in which they live or attend classes after working a full day they want to upgrade their skills in order to be promoted or be qualified for better jobs you set your own pace we help you decide how fast and how far you go\n\nIf you wish to enroll at Winward community college you will find a qualified and very dedicated faculty academic advisors and a career advisor available to help you plan your studies we have an excellent library an active student government lots of free parking and a helping attitude that makes windward community college a very special place to continue your education.\n\nThe college\n\nWindward community college is one of the seven public community colleges in Hawaii governed by the board of regents of the University of Hawaii governed the college is situated in kaneohe on the island of Oahu it opened in the fall of 1972 with an enrollment of 525 students and had a fall 1989 enrollment of 1627 students the college offers both liberal arts and vocational education programs an extensive program of non-credit courses is also offered public affairs forums and cultural presentations are planned throughout the year courses are offered during the day and evening both on and off-campus.",
