function getZoomLvl(){
    let clicks = document.getElementById('zoomCount');
    return parseInt(clicks.innerHTML, 10);
}

// Change card size 
function zoomIn(){
  const fiche_container = document.getElementById('fiche-container');
  const cards = fiche_container.childNodes;
  let zoomlvl = getZoomLvl();
  for(let card of cards){
    if(zoomlvl == -1){
      card.className = 'card';
    } else if(zoomlvl == 0){
      card.className = 'cardzm1';
    } else if(zoomlvl == 1){
      card.className = 'cardzm2';
    } else {
      alert(`Can't Zoom In further`);
      return;
    }
  }
  if (zoomlvl == 2){
    document.getElementById('zoomCount').innerHTML = 0;
  } else{
    let increment = zoomlvl + 1;
    document.getElementById('zoomCount').innerHTML = increment;
  }
}

function zoomOut(){
  const fiche_container = document.getElementById('fiche-container');
  const cards = fiche_container.children;
  let zoomlvl = getZoomLvl();
    for(let card of cards){
      if (zoomlvl == 2){
        card.className = 'cardzm1';
      } else if(zoomlvl == 1){
        card.className = 'card';
      } else if(zoomlvl == 0){
        card.className = 'cardzm-1';
      } else {
        alert(`Can't Zoom Out further`);
        return;
      }
    }
 
  if (zoomlvl == -1){
    document.getElementById('zoomCount').innerHTML = 0;
  } else{
    let decrement = zoomlvl - 1;
    document.getElementById('zoomCount').innerHTML = decrement;
  }
}




